import ExpenseItem from "./components/ExpenseItem";

function App() {
  const newExpenses = [];
  expenses.forEach((expense) => {
    newExpenses.push(
      <div>
        <ExpenseItem expense={expense} />
      </div>
    );
  });
  return newExpenses;
}

export default App;
